Estas son las *Actividades sobre el Día del LIBRO realizadas hoy martes 23 de abril*

&nbsp;

&nbsp;

INFANTIL

Cuento realizado por ellos sobre el proyecto para llevar a casa.

Sus "hermanos mayores"  de cuarto, quinto y sexto han ido a contarles cuentos.

&nbsp;

AULA ENCLAVE

Visualización y lectura del cuento de La oruga glotona.

Y marca-páginas de la oruga con pintura de dedos .

&nbsp;

PRIMER CICLO

Cuentacuentos en 1° por parte de algunas familias.

Amigo invisible de Cuentos  y flores de San Jordi.

&nbsp;

SEGUNDO CICLO

Cuentacuentos de hermanos mayores  de 4° a cuatro años de Infantil.

3° y 4° han creado un cuento para amigo invisible y cada uno lo regaló a su amig@, ...  también  rosa de San Jordi.

&nbsp;

TERCER CICLO

Hermanos mayores: Cuentacuentos de quinto con tres años y sexto con cinco años  de Infantil.

